import React, { Component } from 'react'
import { Spring } from 'react-spring'
import styled, { keyframes } from 'styled-components'

const Primary = styled.h1`
    margin: 50px;
    letter-spacing: 5px;
    text-transform: uppercase;
    line-height: 95%;
    font-size: 2rem;
    color: ${props => props.primary ? "#6f203d" : "white"};
    font-family: 'Oswald', sans-serif;
`

const Collection = styled.h2`
  color:purple;
  padding:10px;
  margin: 20px;
  color: black;
  text-align:center;
  font-family: 'Oswald', sans-serif;
  font-weight: 300;
  border: 1px solid #6f203d;
`
const Wrapper = styled.div`
  display:flex;
  justify-content: center;
`


 class Product extends React.Component {
  render() {
    return (
        <Spring
          from={{ opacity: 0 }}
          to={{ opacity: 1 }}
          config={{ delay:1000, duration:1000 }}
          >
            {props => (
              <div style={props}>
                <Primary primary>Our collections </Primary>
                <Wrapper>
                  <Collection>The Valentine's Collection </Collection>
                  <Collection>Urban Stem Collection </Collection>
                  <Collection>The Vogue Collection </Collection>
                </Wrapper>

            </div>
          )}
        </Spring>
      )
    }
  }


export default Product
